let articles = {}

articles.latestArticles = [
    {
        name:'About JavaScript',
        tag:'Scripting'
    },
    {
        name:'About Node',
        tag:'Framework'
    }
]

articles.sum = (a,b) => {
    return a+b
}

//module.exports = articles
export default articles
